import React from 'react'

export const HomePage = () => {
  return (
    <>
      <div className="hero">
        <div className="hero__container">
          <h1 className="hero__container--title"><span>What is the new</span><br/><span>today?</span></h1>
          <div className="hero__container--bar"></div>
          
        </div>
      </div>
    </>
  )
}
